import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Registration from './components/Registration';

function App() {
  return (
    <Switch>
    <Router>
      <Route exact path="/" component={Registration} />
    </Router>
    </Switch>
  );
}

export default App;
